# Runtime: 772 ms, faster than 41.21% of Python3 online submissions for Shortest Path in Binary Matrix.
# Memory Usage: 14.6 MB, less than 80.65% of Python3 online submissions for Shortest Path in Binary Matrix.
class Solution:
    def shortestPathBinaryMatrix(self, grid: List[List[int]]) -> int:
        n = len(grid)
        toVisit = deque()
        distance = 0
        if not grid[0][0]:
            toVisit.append([0, 0])
        while toVisit:
            distance += 1
            m = len(toVisit)
            for _ in range(m):
                p = toVisit.popleft()
                if p[0] == n - 1 and p[1] == n - 1:
                    return distance
                for i in [-1, 0, 1]:
                    for j in [-1, 0, 1]:
                        if i == 0 and j == 0:
                            continue
                        pn = [p[0] + i, p[1] + j]
                        if 0 <= pn[0] < n and \
                           0 <= pn[1] < n and \
                           not grid[pn[0]][pn[1]]:
                            if pn[0] == n-1 and pn[1] == n-1:
                                return distance + 1
                            grid[pn[0]][pn[1]] = 1
                            toVisit.append(pn)

        return -1


# Runtime: 800 ms, faster than 36.70% of Python3 online submissions for Shortest Path in Binary Matrix.
# Memory Usage: 14.6 MB, less than 90.70% of Python3 online submissions for Shortest Path in Binary Matrix.
class Solution:
    def shortestPathBinaryMatrix(self, grid: List[List[int]]) -> int:
        n = len(grid)
        toVisit = deque()
        visited = [[False] * n for i in range(n)]
        distance = 0
        if not grid[0][0]:
            toVisit.append([0, 0])
        while toVisit:
            distance += 1
            m = len(toVisit)
            for _ in range(m):
                p = toVisit.popleft()
                if p[0] == n - 1 and p[1] == n - 1:
                    return distance
                visited[p[0]][p[1]] = True
                for i in [-1, 0, 1]:
                    for j in [-1, 0, 1]:
                        if i == 0 and j == 0:
                            continue
                        pn = [p[0] + i, p[1] + j]
                        if 0 <= pn[0] < n and \
                           0 <= pn[1] < n and \
                           not visited[pn[0]][pn[1]] and \
                           not grid[pn[0]][pn[1]]:
                            if pn[0] == n-1 and pn[1] == n-1:
                                return distance + 1
                            # grid[pn[0]][pn[1]] = 1
                            visited[pn[0]][pn[1]] = True
                            toVisit.append(pn)

        return -1


